import * as React from 'react';

function Card({ item, handleSelectedCards, isFirstCard, isDisabled }) { 
    if (item?.isMatched) { return <div></div>}

    return ( 
        <div className="item"> 
            <div className={isFirstCard ? "first-card" : ""}> 
                {/* <div 
                    className="back"

                > 
                    {item?.name} 
                </div>  */}
                <button
                    disabled={isDisabled}
                    className="item"
                    onClick={() => handleSelectedCards(item)} 


                >
                {item?.name} 
                </button>
            </div> 
        </div> 
    ); 
} 

export default Card;
